sys_variable_value.value:
(function execute(inputs, outputs) {
  // Only parse the response body if the status code is 200
  if (inputs.status_code == '200'){
    //Parse the response_body input variable and save parsed object as responseBody
    var responseBody = JSON.parse(inputs.response_body);
    var results = [];
    //Map the parsed responseBody values to output variables
    var resultsArray = [];
    var ct = responseBody.count;
    outputs.count = ct;
    results = responseBody.results;
    for(var i = 0; i < ct; i++)
    {   //Create an empty object for each iteration
        var resultObject = {};
    	resultObject.set_num = results[i].set_num;
    	resultObject.name = results[i].name;
    	resultObject.year = results[i].year;
    	resultObject.theme_id = results[i].theme_id;
    	resultObject.num_parts = results[i].num_parts;
    	resultObject.set_img_url = results[i].set_img_url;
    	resultObject.set_url = results[i].set_url;
    	resultObject.last_modified_dt = results[i].last_modified_dt;
        resultsArray[i] = resultObject;
    }
  	outputs.results = resultsArray;
  }
})(inputs, outputs);

